# # D01 asciicircum
#
#   "ª" U00AA FEMININE ORDINAL INDICATOR is a legacy character, superseded by
#   the use of preformatted superscript small letters. This new, regular scheme
#   supports also French, and plural forms, additionally to singular forms, and
#   to Italian, Portuguese, Spanish. As a result, the legacy scheme turns out
#   to be a partial solution designed for limited character sets. Sticking with
#   it in the Unicode era, using live key positions and premium dead key slots,
#   would be utterly inadequate. Instead, legacy ordinal indicators are placed
#   here in symbol group 12 (on matching letters) and supported by multikey.
#   See #^# Legacy ordinal indicators
#   See # # D09 braceright
#
#   In Unicode CLDR, "‌" U200C ZERO WIDTH NON-JOINER is the cursive non-joiner.
#   Consistently, "‍" U200D ZERO WIDTH JOINER is the cursive joiner.
#   The new names are intended to improve familiarity, as opposed to the legacy
#   names based on “ZERO WIDTH”.
#   https://github.com/unicode-org/cldr/blob/f7cb2b5ca09cdaf651912695f93903cc35cab69c/tools/cldr-code/src/main/java/org/unicode/cldr/util/CodePointEscaper.java#L45
