#
#
# # D05 asciitilde
#
#   The positions in groups 1 through 3 could be used for single, double and
#   triple daggers for the sake of mnemonics, but they are not, as daggers are
#   more extensively supported together with their left/right guard or turned
#   counterparts in tilde followed by digits 1 through 6,
#   See #*# TILDE
#
#   Another reason is that these three tilde-based operators are useful, unlike
#   "∼" U223C TILDE OPERATOR that was disunified from ASCII tilde while Unicode
#   is unable to provide any rationale for this disunification.
#   https://www.unicode.org/versions/Unicode15.0.0/UnicodeStandard-15.0.pdf#page=903&zoom=100,0,500
#
#   Consistently, both U223C and U007E display exactly the same, and semantics
#   are also unambiguous. As a result, U223C is not supported in group 1 of ~.
#
