#
#
# # D06 at, dead_greek
#
#   Since v1.7.0, dead_greek is also mapped on level 3 instead of the at sign,
#   that is supported on base level E11, making its level 3 D06 alias redundant
#   so that this position is available for an easier dead_greek duplicate. As a
#   consequence, dead_greek must work as an alias base character for the symbol
#   groups.
#
#   "◌" U25CC is in group 1 as the usual pick for the dotted circle, a generic
#   base character for combining diacritics.
#   https://www.unicode.org/versions/Unicode15.0.0/UnicodeStandard-15.0.pdf#page=80
#   https://www.unicode.org/versions/Unicode15.0.0/UnicodeStandard-15.0.pdf#page=132&zoom=100,0,410
