#   The watch emoji are mapped here based on the mnemonic of time notation.
#
#   "¦" U00A6 BROKEN BAR repurposed as multikey symbol is in group 11, where
#   the “double” mnemonic is carried by the colon base character, while the
#   “single” mnemonic is in the group number, as opposed to group 12 used for
#   "‖" U2016 DOUBLE VERTICAL LINE, consistently with "∥" U2225 in the same
#   group of bar.
