#
#
# # B10 semicolon, section
#
#   The (full) triangular colon is about 40 times more frequent than its half.
#   Consistently, "ː" U02D0 is in group 1, "ˑ" U02D1 in group 2. For mnemonics,
#   rather than the number of triangles, the 1/1 vs 1/2 logic is convenient.
#   https://books.google.com/ngrams/graph?content=%CB%90%2C%CB%91&year_start=1800&year_end=2019&corpus=en-2019&smoothing=3
#
#   "⁛" U205B FOUR DOT MARK is a highlighter mark used by scribes in the margin
#   and is annotated as such in the Unicode Code Charts.
#
#   "⟰" U27F0 is repurposed as the level 5 modifier symbol, with the rationale
#   that this key increments by 4 the level index. Called AltFr on this layout
#   and natively supported by XKB and the Windows TSF, this modifier is easily
#   emulated on macOS. Japanese keyboards have left and right Oyayubi keys that
#   made it into the Windows layout driver source code by Ian James as LOYA and
#   ROYA, but not into ISO/IEC 9995.
#
<UEFD0>                                                                                <semicolon> : "ː" U02D0 # MODIFIER LETTER TRIANGULAR COLON
<Multi_key><numbersign>                                                                <semicolon> : "ː" U02D0 # MODIFIER LETTER TRIANGULAR COLON
