### Letter groups
#
#   These groups contain mainly letters and mathematical letter symbols, but
#   some groups also contain mathematical digit symbols.
#
#   In this section, group headings are prefixed with `#+# `.
#
#   On the alphabet, the groups yield mainly:
#
#   Group  0  (g0): live keys (default, no group selected);
#   Group  1  (g1): group pressed once: Latin;
#   Group  2  (g2): group pressed twice: Latin;
#   Group  3  (g3): group pressed thrice or followed by digit 3: Latin;
#   Group  4  (g4): group pressed 4 times or followed by digit 4: Latin;
#   Group  5  (g5): group then digit 5: Latin;
#   Group  6  (g6): group then digit 6: Greek and Greek math symbols;
#   Group  7  (g7): group then digit 7: Latin script style math symbols;
#   Group  8  (g8): group then digit 8: Latin double-struck/bold/italic math symbols;
#   Group  9  (g9): group then digit 9: Latin fraktur/monospace math symbols;
#   Group 10 (g10): group then digit 0: Latin sans-serif math symbols;
#   Group 11 (g11): group then digit 1: Latin;
#   Group 12 (g12): group then digit 2: Latin.
#
#
